import { AppBar, Toolbar, styled } from '@mui/material';

const StyledToolBar = styled(Toolbar)`
   background: #121212;
   min-height: 56px !important;
`


const Header = () => {
    return (
        <AppBar>
            <StyledToolBar>

            </StyledToolBar>
        </AppBar>
    )
}

export default Header;
